records.addlTxt:
Sidebar held with both parties. Back on the record. Sentencing hearing proceeded. Statements made as to sentencing.

As to COUNT 1-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 42 MONTHS; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 24 MONTHS.  

Court STAYED the sentence and placed defendant on probation for 3 YEARS with the following conditions:

1) Court ordered 120 days of condition time in the House of Correction imposed but STAYED to be used at the discretion of the agent. Defendant to serve 15 of those days upfront, straight time, FORTHWITH;
2) Particiate in a psychological evaluation if one had not been completed in the juvenile case. Follow any treatment or counseling deemed appropriate agent;
3) Pay all costs, fees and surcharges during period of probation. Failure to pay will result in a civil judgment;
4) Provide DNA sample and pay DNA surcharge;
5) No driving without a valid license;
6) Maintain absolute sobriety from all illegal drugs and alcohol;
7) Random urine screens;
8) Attend cognitive thinking class;
9) Perform 40 hours of community service;

Court will allow the probation to be transferred to another state if the receiving state accepts the transfer and the State of Wisconsin approves the transfer. 

If revoked, defendant is eligible for the Challenge Incarceration Program. The defendant is eligible for the Substance Abuse Program.

Court will allow for expungment upon successful completion of all conditions of probation. 

Appellate rights notice given to the defendant. 
